import React from "react";
import styled from "styled-components";
import Title from "../components/styles/title";
import SongStyles from "../components/styles/songStyles";

const Song = ({ song }) => {
  return (
    <SongStyles>
      <Title>{song.title}</Title>
    </SongStyles>
  );
};

export default Song;
